    public static void testQueu() {
        final MyConcurrentCircularQueue<String> fifo = new MyConcurrentCircularQueue<String>(6);

        final AtomicLong counter = new AtomicLong();

        for (int i = 0; i < 10; i++) {
            new Thread(new Runnable() {
                @Override
                public void run() {
                    while (true) {
                        fifo.getAll().toString();
                        try {
                            Thread.sleep(20);
                        } catch (InterruptedException ex) {
                            Logger.getLogger(TestApp.class.getName()).log(Level.SEVERE, null, ex);
                        }
                    }
                }
            }).start();
        }
        new Thread(new Runnable() {
            @Override
            public void run() {
                while (true) {
                    System.out.println(fifo.getAll().toString());
                    System.out.println(" time " + counter.getAndSet(0));
                    try {
                        Thread.sleep(1000);
                    } catch (InterruptedException ex) {
                        Logger.getLogger(TestApp.class.getName()).log(Level.SEVERE, null, ex);
                    }
                }
            }
        }).start();

        for (int i = 0; i < 1; i++) {
            new Thread(new Runnable() {
                @Override
                public void run() {
                    AtomicLong gender = new AtomicLong();
                    while (true) {
                        fifo.add(String.valueOf(gender.incrementAndGet()));
                        counter.incrementAndGet();
                    }
                }
            }).start();
        }
    }

    public static long getDays(int n) {
        Calendar cal = Calendar.getInstance();
        cal.add(Calendar.DAY_OF_MONTH, n);
        return cal.getTimeInMillis();
    }

